  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a combination of point
  data, identifying the entrance location of key destinations, and polygons, identifying
  significant retail areas containing numerous potential destinations. The data was
  developed by the nine Regional Planning Agencies based on a common methodology,
  with input and review from staff at the NH Department of Environmental Services.
  Certain types of destinations were identified for all communities; these included:
  Elementary Schools, Middle Schools, High Schools, Higher Education Facilities, Municipal
  Offices, Libraries (public and private), Community Facilities, Grocery Stores, Athletic/Recreation
  Facilities, Post Offices, Retail/Shopping Areas, Public Transportation Access Point,
  and Hospitals. Additional destinations were identified when significant to a community;
  these could include such places as Smaller Markets, Places of Worship, Restaurant,
  Funeral Homes, Performing Art Centers, Trail Access Points, Town Greens, and Large-scale
  Event Facilities. Destinations are identified separately by type. Descriptions and
  additional information is provided for some data.\",\n\t\"license_title\": null,\n\t\"extras\":
